// 辅助色，用于提示文字或图数据图表等（黄）
@sub-yellow: #ffda44;
@night-sub-yellow: #ffda44;

// 文字颜色 标题及正文
@primary-text: #212832;
@night-primary-text: #212832;

// 文字颜色，二级标题或次要文字颜色
@text-sub: #5d646e;
@night-text-sub: #5d646e;

// 文字颜色，列表备注文案，提示性文字颜色
@text-tip: #adb4be;
@night-text-tip: #adb4be;

// 文字颜色  注释辅助失效颜色
@text-desc: #ccc;
@night-text-desc: #ccc;

// 不可点击按钮颜色
@disabled-button: #e4e4e4;
@night-disabled-button: #e4e4e4;

// 不可点文字颜色
@disabled-text: #bbb;
